  "id_str" : "1007682084750520321",
  "in_reply_to_user_id" : 3119862113,
  "text" : "Another thing, what makes me SO disappointed is the fact that this CB took so long to happen. And the entire time I was watching the MV, all I could think of was how pretty they are. That's it. They're so pretty. The music didn't hold me. Their looks did.",
