  "id_str" : "1007682085832683520",
  "in_reply_to_user_id" : 3119862113,
  "text" : "If you're a longtime YG listener or a music enthusiast in general, such as myself, you'll be greatly disappointed.",
  "id" : 1007682085832683520,
  "in_reply_to_status_id" : 1007682084750520321,
