  "geo" : { },
  "id_str" : "1007680378742554624",
  "in_reply_to_user_id" : 3119862113,
  "text" : "with any BP song release. BP's song releases sound way too Teddy-ish. Too much so that a line between 2NE1's musical identity and BP's musical identity hasn't been clearly drawn even with this new release.",
